const Niramit200 = `@font-face { font-family: 'Niramit'; font-style: normal; font-weight: 200; src: local('Niramit ExtraLight'), local('Niramit-ExtraLight'), url('data:font/woff2;base64,') format('woff2'); }`;
const Niramit200italic = `@font-face { font-family: 'Niramit'; font-style: italic; font-weight: 200; src: local('Niramit ExtraLight Italic'), local('Niramit-ExtraLightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Niramit300 = `@font-face { font-family: 'Niramit'; font-style: normal; font-weight: 300; src: local('Niramit Light'), local('Niramit-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Niramit300italic = `@font-face { font-family: 'Niramit'; font-style: italic; font-weight: 300; src: local('Niramit Light Italic'), local('Niramit-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const NiramitRegular = `@font-face { font-family: 'Niramit'; font-style: normal; font-weight: 400; src: local('Niramit Regular'), local('Niramit-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const NiramitItalic = `@font-face { font-family: 'Niramit'; font-style: italic; font-weight: 400; src: local('Niramit Italic'), local('Niramit-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
